#include <iostream>
#include <vector>
#include <stack>

using namespace std;

// Problem - 907: https://leetcode.com/problems/sum-of-subarray-minimums/
// C++ Solution!
class Solution {
public:
	int sumSubarrayMins(vector<int>& arr) {
		const long long MOD = 10e8 + 7;
		long long res = 0;
		stack<int> stack;

		for (int i = 0; i < arr.size(); i++) {
			int n = arr[i];
			while (!stack.empty() && n < arr[stack.top()]) {
				int j = stack.top();
				int m = arr[j];
				stack.pop();

				int left = stack.empty() ? j + 1 : j - stack.top();
				int right = i - j;

				res = (res + m * left * right) % MOD;
			}
			stack.push(i);
		}

		while (!stack.empty()) {
			int j = stack.top();
			stack.pop();
			int n = arr[j];
			int left = stack.empty() ? j + 1 : j - stack.top();
			int right = arr.size() - j;

			res = (res + n * (long)left * (long)right) % MOD;
		}

		return static_cast<int>(res);
	}
};


